import React from 'react';

class App extends React.Component{
    render(){
        return(
            <header>
                <form id="to-do-form">
                    <div className="form-group">
                        <div className="row">
                            <div className="col">
                                <input className="form-control" type="text" placeholder="Enter Text" />
                            </div>
                            <div className="col">
                                <button type="submit" className="btn btn-primary">Add</button>
                            </div>
                        </div>
                    </div>
                </form>
            </header>
        );
    }
}
export default App;
